import React, { useEffect, useState } from 'react'
import { navLinks } from '../data/data'
import { FaMoon, FaSun, FaBars, FaTimes } from 'react-icons/fa'

export default function Navbar(){
  const [active, setActive] = useState('home')
  const [scrolled, setScrolled] = useState(false)
  const [theme, setTheme] = useState(localStorage.getItem('theme') || 'dark')
  const [mobileOpen, setMobileOpen] = useState(false)
  const [progress, setProgress] = useState(0)

  useEffect(()=>{
    const onScroll = () => setScrolled(window.scrollY > 30)
    window.addEventListener('scroll', onScroll)
    const onHashChange = () => setActive(window.location.hash.replace('#','') || 'home')
    window.addEventListener('hashchange', onHashChange)
    return ()=>{ window.removeEventListener('scroll', onScroll); window.removeEventListener('hashchange', onHashChange) }
  },[])

  useEffect(()=>{
    document.documentElement.classList.toggle('dark', theme==='dark')
    localStorage.setItem('theme', theme)
  },[theme])

  useEffect(()=>{
    const onScrollProgress = () => {
      const scrollTop = window.scrollY || document.documentElement.scrollTop
      const height = document.documentElement.scrollHeight - document.documentElement.clientHeight
      const pct = height ? Math.min(100, Math.round((scrollTop / height) * 100)) : 0
      setProgress(pct)
    }
    window.addEventListener('scroll', onScrollProgress)
    onScrollProgress()
    return ()=> window.removeEventListener('scroll', onScrollProgress)
  },[])

  const handleClick = (id) => {
    setActive(id)
    setMobileOpen(false)
    const el = document.getElementById(id)
    if(el) el.scrollIntoView({ behavior: 'smooth' })
  }

  return (
    <>
      <div className="scroll-progress"><div style={{width: `${progress}%`}}></div></div>
      <header className={`fixed w-full z-40 top-0 transition-all ${scrolled? 'backdrop-blur-md bg-black/30':'bg-transparent'}`}>
        <div className="container mx-auto px-6 py-4 flex items-center justify-between">
          <a href="#home" onClick={(e)=>{e.preventDefault(); handleClick('home')}} className="text-2xl font-bold">Portfolio</a>
          <nav className="hidden md:flex gap-6 items-center">
            {navLinks.map(n => (
              <button key={n.id} onClick={()=>handleClick(n.id)} className={`px-3 py-1 rounded ${active===n.id ? 'text-teal-300 border-b-2 border-teal-300' : 'text-white/80'}`}>
                {n.label}
              </button>
            ))}
            <button onClick={()=>setTheme(t=>t==='dark'?'light':'dark')} className="p-2 rounded bg-white/5">
              {theme==='dark' ? <FaSun /> : <FaMoon />}
            </button>
          </nav>
          <div className="md:hidden flex items-center gap-3">
            <button onClick={()=>setTheme(t=>t==='dark'?'light':'dark')} className="p-2 rounded bg-white/5 text-sm">
              {theme==='dark' ? <FaSun /> : <FaMoon />}
            </button>
            <button onClick={()=>setMobileOpen(v=>!v)} className="p-2 rounded bg-white/5">
              {mobileOpen ? <FaTimes/> : <FaBars/>}
            </button>
          </div>
        </div>
        {mobileOpen && (
          <div className="md:hidden bg-black/60 backdrop-blur-md py-4">
            <div className="container mx-auto px-6 flex flex-col gap-2">
              {navLinks.map(n=> (
                <button key={n.id} onClick={()=>handleClick(n.id)} className={`text-left p-3 rounded ${active===n.id? 'bg-white/5 text-teal-300':'text-white/80'}`}>{n.label}</button>
              ))}
            </div>
          </div>
        )}
      </header>
    </>
  )
}
